import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

const Home = () => {
  const navStyle = {
    display: 'flex',
    justifyContent: 'flex-end',
    backgroundColor: '#333',
    padding: '10px',
  };

  const navLinkStyle = {
    color: 'white',
    margin: '0 10px',
    textDecoration: 'none',
  };

  const genresContainerStyle = {
    textAlign: 'center',
    marginTop: '50px',
  };

  const genreImageStyle = {
    margin: '20px',
    border: '2px solid #ccc',
    borderRadius: '8px',
    width: '250px',
    height: 'auto',
  };

  return (
    <div>
      <nav style={navStyle}>
        <Link to="/login" style={navLinkStyle}>Login</Link>
        <Link to="/register" style={navLinkStyle}>Register</Link>
      </nav>
      <div style={genresContainerStyle}>
        <h1>QuizMaker - By AspireNex</h1>
        <div>
          <h2>Genres:</h2>
          <div>
            <Link to="/quizzes/Science">
              <img src="/SciQuiz.jpg" alt="Science Quiz" style={genreImageStyle} />
            </Link>
            <Link to="/quizzes/Math">
              <img src="/MathQuiz.jpg" alt="Math Quiz" style={genreImageStyle} />
            </Link>
            <Link to="/quizzes/History">
              <img src="/HistoryQuiz.jpg" alt="History Quiz" style={genreImageStyle} />
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
